    return(
        <>
        <form class="Register">
        <h3>Welcome to Recomendation page</h3>
        <input type="text" required="required" size="15" placeholder="COMPANY" id="COMPANY" maxlength="30" /> 
<input type="text" required="required" size="15" placeholder="PRICE(LAKHS)" id="PRICE(LAKHS)" maxlength="30" /> 
<input type="text" required="required" size="15" placeholder="FUEL_TYPE" id="FUEL_TYPE" maxlength="30" /> 
