<input type="text" required="required" size="15" placeholder="TYPE" id="TYPE" maxlength="30" /> 
<input type="text" required="required" size="15" placeholder="BOOTSPACE" id="BOOTSPACE" maxlength="2" /> 
<br></br>
<input type="button" onclick="validation()" size="15" value="Get Recomendation"></input>
</form>
        </>
        );
};

export default Recomendation;
